import React from 'react'

const AddWorker = () => {
  return (
    <form className='flex flex-col justify-center items-center'>
       <label className='flex flex-col justify-start items-center' htmlFor="name">Çalışan İsmi</label>
       <input type="text" placeholder='Çalışan ismi Giriniz' id='name' />
       <label htmlFor="">Maaş Miktarı</label>
       <input type="text" placeholder='Maaş Miktarını Giriniz' />  
    </form>
  )
}

export default AddWorker
